from view import Viewerfrom crawler import Crawlerclass Main(object):    def __init__(self):        self.data = Viewer.read()    def start(self):        for d in self.data:            if d[7] != '':                continue            url = "https://catalog.loc.gov/vwebv/search?searchArg1=" + d[6] + "&argType1=all&searchCode1=GKEY&searchType=2&combine2=and&searchArg2=&argType2=all&searchCode2=GKEY&combine3=and&searchArg3=&argType3=all&searchCode3=GKEY&year=1517-2017&fromYear=&toYear=&location=all&place=all&type=all&language=all&recCount=25"            str = Crawler.crawl(url)            if str != '':                d[7] = str                pass            url = "https://catalog.loc.gov/vwebv/search?searchArg1=" + d[6] + "&argType1=all&searchCode1=GKEY&searchType=2&combine2=and&searchArg2=&argType2=all&searchCode2=GKEY&combine3=and&searchArg3=&argType3=all&searchCode3=GKEY&year=1517-2017&fromYear=&toYear=&location=all&place=all&type=all&language=all&recCount=25"            str = Crawler.crawl(url)            if str != '':                d[7] = str                passif __name__ == "__main__":    Main()